p;&lt;/div&gt;\r\n&lt;div&gt;\r\n	United Kingdom&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	United States Of America&lt;/div&gt;\r\n&lt;div&gt;\r\n	Uruguay&lt;/div&gt;\r\n&lt;div&gt;\r\n	Uzbekistan&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Back To Top&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	V&lt;/div&gt;\r\n&lt;div&gt;\r\n	Vanuatu&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Vatican City State (Holy See)&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Venezuela&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Vietnam&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Virgin Islands (British)&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Virgin Islands (U.S.)&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Back To Top&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	W&lt;/div&gt;\r\n&lt;div&gt;\r\n	Wallis and Futuna Islands&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Back To Top&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Y&lt;/div&gt;\r\n&lt;div&gt;\r\n	Yemen&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Back To Top&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Z&lt;/div&gt;\r\n&lt;div&gt;\r\n	Zaire&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Zambia&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Zimbabwe&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n'),(13,1,'Service Guarantee','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;div&gt;\r\n	What is Dropshipping?&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Drop shipping is a supply chain management technique in which the retailer does not keep goods in stock, but instead transfers customer orders and shipment details to either the manufacturer or a wholesaler, who then ships the goods directly to the customer. As in retail businesses, the majority of retailers make their profit on the difference between the wholesale and retail price but some retailers earn an agreed percentage of the sales in commission, paid by the wholesaler to the retailer.&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Our Serives&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Data Feed&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	We are providing data like product photos,descriptions,prices etc. which are related to our products and also very important to refurbish your own business for 2.99$ per product.&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Batch Orders Support&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	You can upload your orders by clike the link on the very top of our home page, all of the orders are being processed automatically after you complete the payment.&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Green Chanel Payment&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	As an authorised seller or a higher level seller, we guarantee all of your payment will be confirmed within 12 hours by our finance office.&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Notification System&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	To avoid any loss on your side due to our product prices changes or availability status. We will notify you in time in the notifiction center 48 hours ahead of any changes to be made in our data based.&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Sales Report&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Sales report will be issues monthly completely free of any charge to help you make better promotion decisions and product adjustments.&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Ship in 48 Hours&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	We guarantee all of your order will be shipped within 48 hours.&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Confidentiality&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	We keep strict confidentiality of any customer information you provide to us, we will never keep these information for our own business purpose or share it to the third party.And we use non-logo packages to be INVISABLE to your customers.&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Customed Packaging&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	You can made your packaging custom by only pay extra $0.1 to each order. Your logo will be printed on the packages to your customers.&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Free Shipping&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	We are free shipping everything on the website.&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n'),(10,1,'What is Dropshipping','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;div&gt;\r\n	What is Dropshipping?&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Drop shipping is a supply chain management technique in which the retailer does not keep goods in stock, but instead transfers customer orders and shipment details to either the manufacturer or a wholesaler, who then ships the goods directly to the customer. As in retail businesses, the majority of retailers make their profit on the difference between the wholesale and retail price but some retailers earn an agreed percentage of the sales in commission, paid by the wholesaler to the retailer.&lt;/div&gt;\r\n'),(12,1,'Payment Methods','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Accepted Payment Methods&lt;/p&gt;\r\n&lt;p&gt;\r\n	GoDropshipping.com makes paying for your orders/batch orders easy by providing a range of convenient payment options. Below is a guide to the different payment methods used by GoDropshipping.com, so you can choose the right way for you.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Payment Methods:&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	PayPal&lt;/p&gt;\r\n&lt;p&gt;\r\n	Western Union&lt;/p&gt;\r\n&lt;p&gt;\r\n	Wire Transfer&lt;/p&gt;\r\n&lt;p&gt;\r\n	Paying with PayPal&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	PayPal is a secure and trusted payment processing service which allows you to shop online. PayPal can be used at GoDropshipping.com to purchase items by Credit Card (Visa, MasterCard, Discover, and American Express), Debit Card, or E-check (i.e. using your regular Bank Account).&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Using PayPal&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	You do not need to have a PayPal account before ordering from GoDropshipping. We offer two different ways to pay using PayPal, which are as follows:&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	1. On your Shopping Cart page, click after reviewing your items. You will then leave GoDropshipping.com and enter PayPal. Log in to your PayPal account, or create one if you haven\'t already, and follow the on-screen instructions given by PayPal. Once you’ve completed your payment information, you will be directed back to our site where you’ll choose your shipping method and then complete your order.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	2. At your Shopping Cart, choose Checkout and you will be taken to the Order Information page. Under Payment Methods, select PayPal and then click on Continue Checkout. You will then go to PayPal where you can complete your order payment.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Advantages of using PayPal:&lt;/p&gt;\r\n&lt;p&gt;\r\n	Payment is traceable. You can trace the status of your payment using your PayPal account.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Payment does not require you to use your credit card online (you can transfer directly from your bank account).&lt;/p&gt;\r\n&lt;p&gt;\r\n	PayPal protects your personal details when you choose to pay by credit card.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Using Western Union&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	1. On your Shopping Cart page, click &amp;nbsp;Checkout after reviewing your items.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	2. On the Order Information page, under Payment Methods, select the Western Union option.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	3. After checking the details of your order, click checkout or load batch orders. Your orders will now have been placed, but GoDropshipping.com will not start processing your order until you have paid the full amount.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	To complete payment of your orders by Western Union, go to your local Western Union branch, or go to their website, and follow the instructions.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	The Western Union beneficiary details for GoDropshipping.com are:&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Beneficiary:&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	First Name:&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Last Name:&lt;/p&gt;\r\n&lt;p&gt;\r\n	Country:&lt;/p&gt;\r\n&lt;p&gt;\r\n	Address: Room302, Block7, Jixiangli Subdistrict, Chaoyang District, Beijing, PR China, 100025&lt;/p&gt;\r\n&lt;p&gt;\r\n	After successfully transferring the funds, follow the link to the payment details page sent to you by email, fill in the details, and then click send . You\'re done!&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	If you have any further questions regarding your GoDropshipping.com order payment through Western Union, please email: westernunion@godropshipping.com&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	We want every Western Union transaction to go smoothly for our customers, so please be sure to check the total payment amount with them first. GoDropshipping.com cannot cover any handling fees added on by local Western Union branches.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Using Wire Transfer&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	1. On your Shopping Cart page, click Checkout after reviewing your orders.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	2. On the Order Information page, under Payment Methods, select the Wire Transfer option.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	3. After checking the details of your order, click Upload Batch Orders, and after few seconds your orders will now have been placed, but GoDropshipping.com will not start processing your order until you have paid the full amount.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	To complete payment of your items by wire transfer, contact your local bank who will be happy to make the transfer.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	The wire transfer beneficiary details for GoDropshipping.com are:&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Beneficiary Bank:&lt;/p&gt;\r\n&lt;p&gt;\r\n	Beneficiary Bank Address:&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;Swift Code:&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;Account Name:&lt;/p&gt;\r\n&lt;p&gt;\r\n	Account No.:&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	After successfully transferring the funds, follow the link to the payment details page sent to you by email, fill in the details, and then click send. You\'re done!&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	If you have any further questions regarding your GoDropshipping.com order payment through wire transfer, please email: wire@godropshipping.com&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	We want to remind all customers they are responsible for any local handling fees and Intermediary bank handling fees. Therefore, customers should confirm total payment amounts with their local bank.&lt;/p&gt;\r\n');
/*!40000 ALTER TABLE `gds_information_description` ENABLE KEYS */;
UNLOCK TABLES;

